window.bookSummaryJSON = "<p>Anna is back with her pack, but her troubles are far from over. Anna has new allies, but she's also made new enemies. </p> <p>Anna is focused on building her relationships with the guys, and forges a deeper connection with Austin than she ever thought would be possible. </p> <p>But danger lurks within her home, right under her nose. </p> <p>Balancing her relationships, pack responsibilities, ties to the human world, and dedication to discovering her past isn't easy. Add in her need to keep her magic under control and something has got to give. Anna is about to find out that it's not always easy to tell friend from foe. </p> <p><b><i>Contains mature themes.</i></b></p>"; 
